import React from 'react';
import normal_like from "../../assets/icon/normal_like.svg"
import yellow_like from "../../assets/icon/yellow_like.svg"

const like_icon = [normal_like, yellow_like];

export function LikeButton(){
    const ChangeIcon = (i) =>{
        var d = document.getElementById("like-icon");
        d.src = like_icon[i];
    }
    return (
        <img src={normal_like} id="like-icon"
        className='Like-Icon' alt="like-icon"
        onPointerEnter={()=>ChangeIcon(1)}
        onPointerLeave={()=>ChangeIcon(0)}
        />
    );
}
